import React from "react";
import { Link } from "react-router-dom";
import { getWaterBrands } from "../data";

const TableForInvalid2 = () => {
  const waterBrandsSorted = getWaterBrands().sort((a, b) => {
    if (a.total_invalid_count < b.total_invalid_count) return -1;
    if (a.total_invalid_count > b.total_invalid_count) return 1;
    return 0;
  });

  return (
    <table>
      <thead>
        <tr>
          <th>브랜드</th>
          <th>수질적합</th>
          <th>부적합 판정 횟수</th>
          <th>출시일</th>
        </tr>
      </thead>
      <tbody>
        {waterBrandsSorted.map((waterBrand) => (
            <tr key={waterBrand.id}>
              <Link to={waterBrand.id}><th>{waterBrand.name}</th></Link>
              <Link><th>{waterBrand.recent_test_date ? "O" : "X"}</th></Link>
              <Link><th>{waterBrand.total_invalid_count}</th></Link>
              <Link><th>{waterBrand.open_date}</th></Link>
            </tr>
        ))}
      </tbody>
    </table>
  );
};

export default TableForInvalid2;
